import React from 'react'
import ReactDOM from 'react-dom'

const App = () => {
    const feedback = {
        title: 'Give feedback',
        votes: {
            good: 0,
            neutral: 0,
            bad: 0
        },
    }

    return (
        <div>
            <Header {...feedback}/>
            <Buttons/>
            <Table {...feedback}/>
        </div>
    )
}

const Header = (props) => {
    return (
        <h1>{props.title}</h1>
    )
}

const Buttons = (props) => {
    return (
        <>
            <button>Vote up</button>
            <button>Vote neutral</button>
            <button>Vote down</button>
        </>
    )
}

const Table = (props) => {
    return (
        <div>
            <p>Statistics</p>
            <table>
                <TableRow/>

            </table>
        </div>
    )
}

const TableRow = (props) => {
    return (
        <tr>
            <td>{props.title}</td>
            <td>{prop.value}</td>
        </tr>
    )
}

ReactDOM.render(<App/>, document.getElementById('root'))
